import React from 'react'
import PostForm from '../components/test/PostForm'
import Posts from '../components/test/Posts'
import FetchedPosts from '../components/test/FetchedPosts'
import { connect } from 'react-redux';
import { allPosts } from '../redux/actions/userActions';
import { addProviderPost } from '../redux/actions/providerActions';

const Test = props => {
  return (
    <div className="text-white container pt-3">
      <div className="row">
        <div className="col">
          <PostForm />
        </div>
      </div>
      <div className="row">
        <div className="col">
          <h2>Sync posts</h2>
          <Posts syncPosts={props.syncPosts} />
        </div>
        <div className="col">
          <h2>Async posts</h2>
          <FetchedPosts posts={[]} />
        </div>
      </div>
      <button onClick={() => {
        allPosts();
      }}>posts</button>
      <button onClick={() => {
        addProviderPost({
          // поля обзательные:
          gender: 'female',
          age: 25,
          ethnicity: 'some',
          hair_color: 'some',
          eye_color: 'some',
          height: 'some',
          affiliation: 'some',
          number: '+0123456789',
          email: 'some@mail.com',
          model_name: 'some',
          video_link: 'some',
          about: 'some',
          available_to: ['some', 'some'],
          availability: ['some', 'some'],
          summary: 'some',
          second_name: 'some',
          account_name: 'some',
          category: 'some',
          //         не обязательные поля:
          status: 'other',
          // photo(пока 1, добавлю возможность добавлять более 1), также приходит 403 для физиков, если у него уже есть один пост и хочет создать еще один, возвращаю пост
        });
      }}>add post</button>
    </div>
  )
}

const mapStateToProps = (state) => {
  return {
    syncPosts: state.testPosts.posts
  };
};

const mapDispatchToProps = {
  // decrementCounter
};

export default connect(mapStateToProps, mapDispatchToProps)(Test);
